import React, { Component } from 'react';
class TinTuc extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: ""
    };
  }
  async componentDidMount() {
    //const response = await fetch('server-spring-boot-api.herokuapp.com/api/CheckKey111');
    //fetch("server-spring-boot-api.herokuapp.com/api/CheckKey")
    fetch("ex1.o7planning.com/_testdatas_/simple-text-data.txt", {
      method: "GET",
    })
      .then(function (response) {
        console.log("OK! Server returns a response object:");
        console.log(response);
      })
      .catch(function (error) {
        console.log("Noooooo! Something error:");
        // Network Error!
        console.log(error);
      });

  }


  render() {

    return (
      <div>{this.state.items}</div>
    )
  }
}
export default TinTuc;
